import React from "react"
import {Card, Button, Container, Row, Col} from "react-bootstrap";
import "../styles/Homepage.css";


export default function HomePage() {
    return (
        <Container fluid className="d-flex justify-content-center mt-5" >
            <Row>
                <Col sm={12} size={8}>
                    <h1>hello</h1>
                </Col>
            </Row>
        </Container>
    );
}
